results:
  Age:
    code:
    - - '.hasMin(''Age'', lambda x: x > 0)'
      - Passed
    - - .isComplete('Age')
      - Passed
    - - .isNonNegative('Age')
      - Passed
  Billing Amount:
    code:
    - - .isComplete('Billing Amount')
      - Passed
  Gender:
    code:
    - - .isComplete('Gender')
      - Passed
    - - .isContainedIn('Gender', ['Male', 'Female'])
      - Passed
  Medical Condition:
    code:
    - - .isComplete('Medical Condition')
      - Passed
    - - .isContainedIn('Medical Condition', ['Diabetes', 'Asthma', 'Obesity', 'Hypertension',
        'Arthritis', 'Cancer'])
      - Passed
  Test Results:
    code:
    - - .isComplete('Test Results')
      - Failed
    - - .isContainedIn('Test Results', ['Abnormal', 'Normal', 'Inconclusive'])
      - Failed
  id:
    code:
    - - .isComplete('id')
      - Passed
    - - .isNonNegative('id')
      - Passed
    - - .isUnique('id')
      - Passed
